const test = require('ava');

const findAllAnagramsInAString = require('./findAllAnagramsInAString');

test('findAllAnagramsInAString first test case', t => {
  const s = 'cbaebabacd';
  const p = 'abc';
  const expected = [0,6];
  t.deepEqual(findAllAnagramsInAString(s, p), expected);
});

test('findAllAnagramsInAString second test case', t => {
  const s = 'abab';
  const p = 'ab';
  const expected = [0,1,2];
  t.deepEqual(findAllAnagramsInAString(s, p), expected);
});

test('findAllAnagramsInAString third test case', t => {
  const s = 'baa';
  const p = 'aa';
  const expected = [1];
  t.deepEqual(findAllAnagramsInAString(s, p), expected);
});

test('findAllAnagramsInAString fourth test case', t => {
  const s = '';
  const p = '';
  const expected = [0, 10001];
  t.deepEqual(findAllAnagramsInAString(s, p), expected);
});

test('findAllAnagramsInAString fifth test case', t => {
  const s = '';
  const p = '';
  const expected = [];
  t.deepEqual(findAllAnagramsInAString(s, p), expected);
});
